import PaymentForm from "./Components/PaymentFormNew";
import Profile from "./Components/Profile";
import ReceiptsItemsTable from "./Components/Receipts";

export const RouteList = [
  {
    id: "payments",
    path: "/app/Payments",
    element: <PaymentForm/>,
  },
  {
    id: "profile",
    path: "/app/Profile",
    element: <Profile/>,
  },
  {
    id: "receipts",
    path: "/app/Receipts",
    element: <ReceiptsItemsTable/>,
  },
];
